import React from "react";
import arr from "./all/50.mp4";
import "./App.css";
import ReactPlayer from "react-player";

const App = () => {

    const divStyle = {
        width: '150px',
        height: '200px',
      };
  return <ReactPlayer style={divStyle} url={arr} loop muted playing></ReactPlayer>;
};

export default App;
